  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEM includes best available lidar data known to exist at the time of DEM creation
  that meets project specifications for those counties within the boundary of the
  Lake Charles, LA Weather Forecast Office (WFO), as defined by the NOAA National
  Weather Service. The DEM is derived from LiDAR datasets collected for the Texas
  Water Development Board (TWDB). LiDAR data for Orange and Jefferson counties was
  collected for the TWDB in 2006. Hydrographic breaklines used in the creation of
  the DEM were delineated using LiDAR intensity imagery generated from the TWDB datasets.
  The DEMs are hydro flattened such that water elevations are less than or equal to
  0 meters. The DEM is referenced vertically to the North American Vertical Datum
  of 1988 (NAVD88) with vertical units of meters and horizontally to the North American
  Datum of 1983 (NAD83). The resolution of the DEM is approximately 10 meters.\",\n\t\"owner_org\":
